import {StyleSheet, Text, View, Button} from "react-native";
import {LinearGradient} from "expo-linear-gradient";

export default function App() {
  return (
    <View style={styles.container}>
      <LinearGradient colors={["#904e95", "#e96443"]} style={styles.linearGradient} start={[0.2,0]} end = {[0,1]} />
      <Text style={styles.titleText}>Beginners?</Text>
      <Text style={styles.text}>See what we can do for you.</Text>
      <View>
        <Button>BINGO</Button>

      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    fontFamily: "sf compact text",
    paddingLeft: "30px",
    paddingTop: "75px"
  },

  titleText: {
    color: "#fff",
    fontSize: "50px",
    fontWeight: "700",
    letterSpacing: "1px",
  },

  text: {
    color: "#fff",
    fontSize: "17px",
    marginTop: "2px"
  },

  buttonBox: {

  },

  linearGradient: {
    zIndex: -1,
    position: "absolute",
    left: 0,
    right: 0,
    top: 0,
    height: "100%"
  }

});
